import React, {useEffect} from "react";
import "./Home.css";
// import { imageEffect } from "sheryjs";
// import ProfileImg from "/Users/jarvis/Desktop/Porfolio/KESHAV'S portfolio/Portfolio/src/components/minion.png";
import { FaTwitter, FaDribbble, FaBehance } from 'react-icons/fa';
// import Shery from "sheryjs";
import gsap from 'gsap';
import Shery from 'sheryjs';

const Home = () => {
    useEffect(() => {
        // ... (your component code)

        const elements = document.querySelectorAll(".elem");
        elements.forEach(function (elem) {
          const h1s = elem.querySelectorAll("h1");
          let index = 0;
          let animating = false;

          document.querySelector("#main").addEventListener("click", function () {
            if (!animating) {
              animating = true;
              gsap.to(h1s[index], {
                top: "-=100%",
                ease: 'power2.inOut', // Use GSAP easing function directly
                duration: 1,
                onComplete: function () {
                  gsap.set(this._targets[0], { top: "100%" });
                  animating = false;
                },
              });

              index === h1s.length - 1 ? (index = 0) : index++;

              gsap.to(h1s[index], {
                top: "-=100%",
                ease: 'power2.inOut', // Use GSAP easing function directly
                duration: 1,
              });
            }
          });
        });
      }, []); 

    return (

        <div id="main">
        <div id="back">
          <img className="img" src="/Users/jarvis/Desktop/Porfolio/KESHAV'S portfolio/Portfolio/assets/1.jpg" alt="#" />
          <img className="img" src="/Users/jarvis/Desktop/Porfolio/KESHAV'S portfolio/Portfolio/assets/2.jpg" alt="#" />
          <img className="img" src="/Users/jarvis/Desktop/Porfolio/KESHAV'S portfolio/Portfolio/assets/3.jpg" alt="#" />
          <img className="img" src="/Users/jarvis/Desktop/Porfolio/KESHAV'S portfolio/Portfolio/assets/4.jpg" alt="#" />
          <img className="img" src="/Users/jarvis/Desktop/Porfolio/KESHAV'S portfolio/Portfolio/assets/5.jpg" alt="#" />

        </div>
        <div id="top">
          <div id="working">
            <div id="nav">
              <div id="nleft">
                <img src="raybanlogo.png" alt="" />
                <a href="#">About</a>
                <a href="#">Products</a>
              </div>
              <div id="nright">
                <a href="#">Services</a>
                <a href="#">Contact</a>
              </div>
            </div>
            <div id="hero">
              <div id="heroleft">
                <div className="elem">
                  <h1>Hey!! </h1>
                  <h1> </h1>
                  <h1>KESHAV </h1>
                  <h1>DAYAL</h1>
                  <h1>Embrace and</h1>
                </div>
                <div className="elem">
                  <h1>My Name is</h1>
                  <h1>Dream</h1>
                  <h1>awaits go </h1>
                  <h1>adventure</h1>
                  <h1>cherish the</h1>
                </div>
                <div className="elem">
                  <h1>KESHAV <br />
                  DAYAL</h1>
                  <h1>Live.</h1>
                  <h1>find it.</h1>
                  <h1>seize it</h1>
                  <h1>memories.</h1>
                </div>
                <button>Explore Now</button>
              </div>
            </div>
          </div>
        </div>
      </div>
    )
}

export default Home;
